"${SRCROOT}/build/Release-iphonesimulator/${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule/\" \"${DEST_DIR}${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule\"\n\n# 9\n# Create tar files\ntar czf \"${DEST_DIR}all/${FRAMEWORK_NAME}.framework-all.tar.gz\" -C \"${DEST_DIR}all/\" \"./${FRAMEWORK_NAME}.framework\"\ntar czf \"${DEST_DIR}device_only/${FRAMEWORK_NAME}.framework-device_only.tar.gz\" -C \"${DEST_DIR}device_only/\" \"./${FRAMEWORK_NAME}.framework\"\n\n# 10\n# Delete the most recent build.\nif [ -d \"${SRCROOT}/build\" ]; then\nrm -rf \"${SRCROOT}/build\"\nfi\n";
